Feign itself does not provide a specific mechanism for adding cookies through its declarative syntax. Typically, cookies are added in headers using request interceptors. However, managing SameSite attributes (`SameSite=Lax`, `SameSite=Strict`, etc.) is typically a browser-specific concern for cookies sent back to the server. When sending cookies from a client, you will need to specify them in the header directly.

Here is how you can specify cookies with attributes such as `SameSite=Lax` using a `RequestInterceptor`:

1. **Define a Feign Request Interceptor with SameSite Attribute**:

   ```java
   import feign.RequestInterceptor;
   import feign.RequestTemplate;
   import org.springframework.context.annotation.Bean;
   import org.springframework.context.annotation.Configuration;

   @Configuration
   public class FeignClientConfig {

       @Bean
       public RequestInterceptor cookieInterceptor() {
           return new RequestInterceptor() {
               @Override
               public void apply(RequestTemplate template) {
                   template.header("Cookie", "myCookieName=myCookieValue; SameSite=Lax");
               }
           };
       }
   }
   ```

2. **Configure the Feign Client**: Use the configuration class created above in your Feign client.

   ```java
   import org.springframework.cloud.openfeign.FeignClient;
   import org.springframework.web.bind.annotation.GetMapping;

   @FeignClient(name = "exampleClient", url = "http://example.com", configuration = FeignClientConfig.class)
   public interface ExampleClient {

       @GetMapping("/some-endpoint")
       String getSomeData();
   }
   ```

3. **Usage**: Inject and use the Feign client in your service or controller.

   ```java
   import org.springframework.beans.factory.annotation.Autowired;
   import org.springframework.stereotype.Service;

   @Service
   public class ExampleService {

       @Autowired
       private ExampleClient exampleClient;

       public void doSomething() {
           String data = exampleClient.getSomeData();
           // Process the data
       }
   }
   ```

If you need a more dynamic approach where cookie values or attributes change at runtime, then you have to dynamically manage them using some form of thread-local storage or custom logic inside your interceptor.

### Dynamic Cookie Management Example

1. **Thread-local Storage for Dynamic Cookies**:

   ```java
   import feign.RequestInterceptor;
   import feign.RequestTemplate;

   public class DynamicCookieInterceptor implements RequestInterceptor {

       private static final ThreadLocal<String> currentCookie = new ThreadLocal<>();

       public static void setCurrentCookie(String cookie) {
           currentCookie.set(cookie);
       }

       @Override
       public void apply(RequestTemplate template) {
           String cookie = currentCookie.get();
           if (cookie != null) {
               template.header("Cookie", cookie);
           }
       }
   }
   ```

2. **Configuration Class**:

   ```java
   import org.springframework.context.annotation.Bean;
   import org.springframework.context.annotation.Configuration;

   @Configuration
   public class FeignClientDynamicConfig {

       @Bean
       public DynamicCookieInterceptor dynamicCookieInterceptor() {
           return new DynamicCookieInterceptor();
       }
   }
   ```

3. **Setting and Using the Dynamic Cookie**:

   ```java
   import org.springframework.beans.factory.annotation.Autowired;
   import org.springframework.stereotype.Service;

   @Service
   public class ExampleService {

       @Autowired
       private ExampleClient exampleClient;
       @Autowired
       private DynamicCookieInterceptor dynamicCookieInterceptor;

       public void doSomething() {
           DynamicCookieInterceptor.setCurrentCookie("myCookieName=myCookieValue; SameSite=Lax");
           String data = exampleClient.getSomeData();
           // Process the data
           DynamicCookieInterceptor.setCurrentCookie(null); // Clean up after use
       }
   }
   ```

In this example, `DynamicCookieInterceptor` uses a thread-local variable to set and manage the cookie dynamically. This provides greater flexibility if cookie values or attributes need to change during runtime.

