In Java, the generic type parameter `<P extends Object>` is functionally equivalent to simply using `<P>`. This is because all types in Java implicitly extend `Object`, which is the root of the class hierarchy.

Here are two examples to illustrate this:

### Example with `<P extends Object>`
```java
public class MyClass<P extends Object> {
    private P value;

    public MyClass(P value) {
        this.value = value;
    }

    public P getValue() {
        return value;
    }
}
```

